import React from 'react'
import {Line} from 'react-chartjs-2';
import myData from '../adata.json';

import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
  } from 'chart.js';
  
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

//[
//   1990,1991,1992,1993,1994,1995,1996,1997,1998,1999,
//   2000,2001,2002,2003,2004,2005,2006,2007,2008,2009,
//   2010,2011,2012,2013,2014,2015,2016,2017,2018,2019,
//   2020,2021,
// ]

const data = {
    labels: myData.map,
    datasets: [
      //RUG
        {
          label: 'RUG',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(75,192,192,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.RUG;
          })
        },
      //UvA
        {
          label: 'UVA',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(70,130,180,1)',
          borderColor: 'rgba(70,130,180,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.UVA;
          })
        },
      //RU
        {
          label: 'RU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(85,107,47,1)',
          borderColor: 'rgba(85,107,47,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.RU;
          })
        },
      //VU
        {
          label: 'VU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(147,112,219,1)',
          borderColor: 'rgba(147,112,219,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.VU;
          })
        },
      //TUD
        {
          label: 'TUD',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(220,20,60,1)',
          borderColor: 'rgba(220,20,60,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.TUD;
          })
        },
      //TUE
        {
          label: 'TUE',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(138,43,226,1)',
          borderColor: 'rgba(138,43,226,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.TUE;
          })
        },
      //WUR
        {
          label: 'WUR',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(0,0,205,1)',
          borderColor: 'rgba(0,0,205,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.WUR;
          })
        },
      //EUR
        {
          label: 'EUR',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(0,128,128,1)',
          borderColor: 'rgba(0,128,128,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.EUR;
          })
        },
      //UU
        {
          label: 'UU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(0,250,154,1)',
          borderColor: 'rgba(0,250,154,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.UU;
          })
        },
      //LU
        {
          label: 'LU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(0,255,0,1)',
          borderColor: 'rgba(0,255,0,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.LU;
          })
        },
      //UM
        {
          label: 'UM',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(255,215,0,1)',
          borderColor: 'rgba(255,215,0,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.UM;
          })
        },
      //UT
        {
          label: 'UT',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(255,69,0,1)',
          borderColor: 'rgba(255,69,0,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.UT;
          })
        },
      //UvT
        {
          label: 'UvT',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(240,128,128,1)',
          borderColor: 'rgba(240,128,128,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.UvT;
          })
        },
        
      ]
};


// const config = {
//     type: 'line',
//     data: data,
//     options: {
//       responsive: true,
//       plugins: {
//         tooltip: {
//           mode: 'index',
